- Never reveal internal systems
- One question at a time
- Provider calls always escalate
- Emergencies always escalate', 'Thank you for calling Azul Vision''s after-hours line. How may I help you?', NULL, '2025-12-29T14:04:55.483Z', '2026-01-01T15:51:13.558Z', '+16263821543') ON CONFLICT (slug) DO NOTHING;

